css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #000000;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #e0e0e0;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #e0e0e0;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #e0e0e0;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #ffffff;
  color: #000000;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f0f0f0;
  color: #000000;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #000000;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #e0e0e0;
}
atom-text-editor .invisible,
:host .invisible {
  color: #000000;
}
atom-text-editor .cursor,
:host .cursor {
  color: #000000;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #c2e8ff;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
:host.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host.is-focused .line.cursor-line {
  color: #f0f0f0;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #e0e0e0;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #000000;
}
.comment {
  color: #9f9f8f;
}
.entity.name.type {
  color: #f25a00;
  text-decoration: underline;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #6aaf19;
}
.keyword {
  color: #f92672;
}
.keyword.control {
  color: #ae81ff;
}
.keyword.operator {
  color: #000000;
}
.keyword.other.special-method {
  color: #28c6e4;
}
.keyword.other.unit {
  color: #fd971f;
}
.storage {
  color: #f92672;
}
.storage.type {
  font-style: italic;
  color: #28c6e4;
}
.constant {
  color: #fd971f;
}
.constant.character.escape {
  color: #28c6e4;
}
.constant.numeric {
  color: #ae81ff;
}
.constant.language {
  color: #ae81ff;
}
.constant.character {
  color: #ae81ff;
}
.constant.other {
  color: #ae81ff;
}
.constant.other.color {
  color: #28c6e4;
}
.constant.other.symbol {
  color: #6aaf19;
}
.variable {
  color: #f92672;
}
.variable.interpolation {
  color: #e60657;
}
.variable.parameter {
  font-style: italic;
  color: #fd971f;
}
.variable.parameter.function {
  color: #000000;
}
.invalid {
  color: #f8f8f0;
  background-color: #f92672;
}
.invalid.deprecated {
  color: #f8f8f0;
  background-color: #ae81ff;
}
.invalid.illegal {
  background-color: #f92672;
  color: #ffffff;
}
.string {
  color: #f25a00;
}
.string.regexp {
  color: #28c6e4;
}
.string.regexp .source.ruby.embedded {
  color: #fd971f;
}
.string.other.link {
  color: #f92672;
}
.punctuation.definition.comment {
  color: #9f9f8f;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #28c6e4;
}
.punctuation.definition.bold {
  color: #f25a00;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ae81ff;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #e60657;
}
.support.class,
.support.type {
  font-style: italic;
  color: #28c6e4;
}
.support.function {
  color: #28c6e4;
}
.support.function.any-method {
  color: #28c6e4;
}
.support.constant {
  color: #28c6e4;
}
.entity.name.function {
  color: #6aaf19;
}
.entity.name.class,
.entity.name.type.class {
  text-decoration: underline;
  color: #6aaf19;
}
.entity.name.section {
  color: #28c6e4;
}
.entity.name.tag {
  color: #f92672;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #6aaf19;
}
.entity.other.attribute-name.id {
  color: #28c6e4;
}
.meta.class {
  color: #f25a00;
}
.meta.link {
  color: #fd971f;
}
.meta.require {
  color: #28c6e4;
}
.meta.selector {
  color: #ae81ff;
}
.meta.separator {
  background-color: #c2e8ff;
  color: #000000;
}
.none {
  color: #000000;
}
.markup.bold {
  color: #fd971f;
  font-weight: bold;
}
.markup.changed {
  color: #ae81ff;
}
.markup.deleted {
  color: #f92672;
}
.markup.italic {
  color: #ae81ff;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #28c6e4;
}
.markup.inserted {
  color: #6aaf19;
}
.markup.list {
  color: #f92672;
}
.markup.quote {
  color: #fd971f;
}
.markup.raw.inline {
  color: #6aaf19;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #6aaf19;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
